The Pegan Diet and Using Foods as Medicine to Boost Immunity

@drmarkhyman joined me today on The Dr. Axe Show to talk about the health transformations he has seen from thousands of patients by using foods as medicine. We also discussed his new book, The Pegan Diet, which explains how to reclaim your health by combining principles from both paleo and vegan diets.

Dr. Hyman is a practicing family physician and an internationally recognized leader, speaker, educator, and advocate in the field of Functional Medicine. He is the founder and director of The UltraWellness Center, the Head of Strategy and Innovation of the Cleveland Clinic Center for Functional Medicine, a thirteen-time New York Times bestselling author, and Board President for Clinical Affairs for The Institute for Functional Medicine. He is the host of one of the leading health podcasts, The Doctor’s Farmacy.
